// BEGIN ACTUAL CODE THAT ENHANCES USER CONTENT
!function(){
  var myJquery = $.noConflict(true)

  function makeJqueryUIWidgetsFromUserContent () {
    var $widgets = myJquery('.user_content:not(.jqueryUIWidgetized)').addClass('jqueryUIWidgetized')
      .find('.enhanceable_content:not(.jqueryUIWidgetized)')

    if ($widgets.length) {
      $widgets.addClass('jqueryUIWidgetized').show()

      // all of the `.is('.ui-*` and `:not(.ui-*` checks are to skip doing anything if canvas has already widgetized things
      $widgets.filter('.dialog').each(function () {
        var $dialog = myJquery(this)
        var widgetizedByMe = false
        if (!$dialog.is('.ui-dialog-content')) {
          $dialog.hide()
          $dialog.closest('.user_content').find('a[href="#' + $dialog.attr('id') + '"]').click(function (event) {
            if (!$dialog.is('.ui-dialog-content') || widgetizedByMe) {
              widgetizedByMe = true
              event.preventDefault()
              $dialog.dialog({
                modal: true
              }).dialog('widget').addClass('jqueryUIWidgetized')
            }
          })
        }
      })
      $widgets.filter('.draggable:not(.ui-draggable)').draggable()
      $widgets.filter('.resizable:not(.ui-resizable)').resizable()
      $widgets.filter('.sortable:not(.ui-sortable)').sortable()
      $widgets.filter('.accordion:not(.ui-accordion)').accordion()
      $widgets.filter('.tabs:not(.ui-tabs)').each(function () { myJquery(this).tabs() })
    }
  }

  try {
    $.subscribe('userContent/change', makeJqueryUIWidgetsFromUserContent)
  } catch (e) { }

  myJquery(document).bind('user_content_change', makeJqueryUIWidgetsFromUserContent)
  setInterval(makeJqueryUIWidgetsFromUserContent, 5000)
  makeJqueryUIWidgetsFromUserContent()
}()
